<!DOCTYPE html>
<html>

<head>
    <meta charset="utf-8" />
    <title>Redirectingâ€¦</title>
    <script>
        (function (l) {
            var repo = '/menu_quecarajos';
            if (l.pathname.startsWith(repo)) {
                var path = l.pathname.slice(repo.length);
                var search = l.search || '';
                var hash = l.hash || '';
                l.replace(repo + '/index.html?redirect=' + encodeURIComponent(path + search + hash));
            }
        })(window.location);
    </script>
</head>

<body></body>

</html>
